import React, { useEffect, useState } from 'react'

const User = () => {

  const tabArray = ["Add a post", "All Posts", "Account Settings"]
  const [activeTab, setActiveTab] = useState()
  const [addAPost, setAddAPost] = useState(true)
  const [allPost, setAllPost] = useState([])
  const [allPostTab, setAllPostTab] = useState(false)
  const [acctSettings, setAcctSettings] = useState(false)
  
  const [myPost, setMyPost] = useState('')
  const [mytitle, setMyTitle] = useState('')

  const user = JSON.parse(localStorage.getItem('user'))

  function handleTabChange(tab){
    setActiveTab(tab)
    if(activeTab === "Add a post"){
      setAddAPost(true)
      setAcctSettings(false)
      setAllPostTab(false)
    }

    if(activeTab === "All Posts"){
      setAddAPost(false)
      setAcctSettings(false)
      setAllPostTab(true)
    }

    if(activeTab === "Account Settings"){
      setAddAPost(false)
      setAcctSettings(true)
      setAllPostTab(false)
    }
  }

  const handlePost = async () => {
    const res = await fetch('https://mytaskz.onrender.com/add-todo', {
      method:"POST",
      body: JSON.stringify({description: myPost, title: mytitle}),
      headers: {
        "Content-Type":"application/json",
        Authorization:`Bearer ${user.token}`
      }
    })
    const data = await res.json()
    if(res.ok){
      getAllMyPost()
      setAddAPost(false)
      setAllPostTab(true)
    }
    console.log(res, data);
  }

  const getAllMyPost = async () => {
    const res = await fetch('https://mytaskz.onrender.com/tasks', {
      headers: {
        Authorization:`Bearer ${user.token}`
      }
    })
    const data = await res.json()
    setAllPost(data.todos.reverse())
    console.log(res, data);
  }

  const deletePost = async (id) => {
    const res = await fetch(`https://mytaskz.onrender.com/tasks/${id}`, {
      method:"DELETE",
      headers: {
        Authorization:`Bearer ${user.token}`
      }
    })
    const data = await res.json()
    if(res.ok){
      getAllMyPost()
    }
    console.log(res, data);
  }

  const [imgFile, setImgFile] = useState('')

  function showFile(){
    var fileReader = new FileReader();
    fileReader.onloadend = function() {
      console.log('RESULT', fileReader.result)
    }
    fileReader.readAsDataURL(imgFile);
  }



  useEffect(() => {
    getAllMyPost()
  },[])

  return (
    <div className='flex flex-col bg-[#030712] px-[5rem] py-[3rem] w-[50%] text-white mx-auto my-20 rounded-xl shadow-slate-700 shadow-inner'>
      <div>
        <h2 className='font-bold text-[35px] py-3'>Dashboard</h2>
      </div>
      <div className='flex py-[1rem] gap-[30px] text-[20px]' style={{borderTop: '1px solid white'}}>
        {
          tabArray.map(tab => (
            <p className=' cursor-pointer' onClick={() => handleTabChange(tab)} >{tab}</p>
          ))
        }
      </div>
      {
        addAPost && 
        <>
          <div className='py-[20px]' style={{borderTop: '1px solid white'}}>
            <input type="text" onChange={e => setMyTitle(e.target.value)} className='px-[5px] py-[8px] w-[105%] text-black outline-none rounded-md' placeholder='add a title'/>
          </div>
          <div>
            <textarea onChange={e => setMyPost(e.target.value)} placeholder='create a post' className='outline-none px-[5px] text-black rounded-md' cols="84" rows="9"></textarea>
          </div>
          <button onClick={handlePost} className='bg-slate-800 text-[#030712] m-auto w-[105%] py-[8px] mt-3 hover:bg-red-700'>POST</button>
        </>
      }
      {
        allPostTab && 
        <div>
          {
            allPost.map(post => (
              <div style={{borderTop: '1px solid white'}} className='flex justify-between py-[30px]'>
                <h2>{post.title}</h2>
                <div className='flex gap-2'>
                  <button className='bg-white text-black px-[10px] py-[10px] rounded-md'>EDIT</button>
                  <button className='bg-red-700 text-black px-[10px] py-[10px] rounded-md' onClick={() => deletePost(post._id)} >DELETE</button>
                </div>
              </div>
            ))
          }
          <div className='flex justify-center gap-10'>
            <button className='bg-slate-800 text-[#030712] py-[8px] mt-3 hover:bg-red-700 px-[10px] rounded-md shadow-gray-50 shadow-sm'>Previous</button>
            <button className='bg-slate-800 text-[#030712] py-[8px] mt-3 hover:bg-red-700 px-[10px] rounded-md shadow-gray-50 shadow-sm'>Next</button>
          </div>
        </div>
      }
      {
        acctSettings && 
        <>
          <div style={{borderTop: '1px solid white'}}>
              <h2 className='text-[20px] pt-[24px] pb-[3px]'>Username</h2>
              <input type="text" className='px-[5px] py-[8px] w-[100%] text-black outline-none rounded-md' placeholder='*******' />
          </div>
          <div className='py-[25px]'>
              <h2 className='text-[20px] py-[3px]'>Password</h2>
              <input type="text" className='px-[5px] py-[8px] w-[100%] text-black outline-none rounded-md' placeholder='*******' />
          </div>
          <div>
              <h2 className='text-[20px] py-[3px]'>New Password</h2>
              <input type="text" className='px-[5px] py-[8px] w-[100%] text-black outline-none rounded-md' placeholder='*******' />
          </div>
        </>
      }

      <div>
        <input onChange={e => setImgFile(e.target.files[0])} type="file" name="" id="" />
        <button onClick={showFile}>Click</button>
      </div>

      <img src="data:image/png;base64," alt="" />

    </div>
  )
}

export default User